    "id_str": "711471873683402752",
    "text": "每個人都用音樂串流，那麼替一本小說製作「播放列表」也得成為編輯的工作。即使是紙書，倒好咖啡、喬好舒適的座位，下一步就是掃一下書上的條碼，書裡提到或合適的音樂自然漫溢。當然，電子書能隨著閱讀進度自動播放，甚至是調整相對音量大小，更佳。 #立體閱讀",
