        "text": "今天忍不住對年輕朋友說了真話：買一台 Kindle 吧。方便的字典，各類型英文書籍的試讀，就是持續增進英文實力的妙方，即使一本都不買，也有讀不盡的素材；大量掃讀各類別的排行榜、分類書目、目錄結構、出版選題與作家，就是隨時隨地、唾手可得的學習工具。現代出版人不善用它太可惜了。",
