    "text": "以蘋果輸掉電子書官司為引，這篇短文把這幾年美國電子書的發展與現況解釋得很清楚，幾乎等同懶人包。紛紛擾擾之中，74%市佔的亞馬遜已立於不敗之地，值得注意的是Kindle有六成書源非來自傳統出版商，佔銷售的四成。 https://t.co/KkQ3jOkkq1",
