    "text": "朋友的寶貝女兒念中山女高，功課好、英文佳，講話邏輯清晰，組織日常事務條理分明、計畫嚴謹，長得又漂亮，一看就是女強人的架勢。忍不住問她，志向是什麼？想在哪方面發光發熱？她很認真的回答我...\n\n「嫁個有錢人」。 #真實案例",
